import React from 'react';
import './Cover.css';

function Cover() {
    return (
        <div className="cover-container">
            <div className="cover-text">
                <h1>HelloWorld</h1>
                <p>
                    My name is Shahaf, nice to meet you! <br />
                    ◦ Data Scientist, Machine Learning Engineer, AI Enthusiast <br />
                    ◦ Boston University Alumni (MS in AI '24, BA in CS '22) <br />
                    ◦ Las Positas College Alumni (AS in CS, AS in Physics, AA in Mathematics '20)
                </p>
                <a href="attachments/pdfs/resume.pdf" download className="resume-button">Resume</a>
            </div>
        </div>
    );
}

export default Cover;
